import react from "react";

function header() {
  return (
    <div className="header">
      <div className="logo">
        <img src="https://www.gstatic.com/meet/google_meet_horizontal_wordmark_2020q4_2x_icon_124_40_292e71bcb52a56e2a9005164118f183b.png"></img>
        <span>Meet</span>
      </div>
      
    </div>
  );
}
export default header;
